import React from 'react'

import {Carousel} from 'react-bootstrap'


const MyCarousel = ({titulo, texto, imagem}) => {
    return(
        <>
            <img
                style={{'maxHeight':"600px"}}
                className="d-block w-100"
                src={imagem}
                alt="First slide"
            />
            <Carousel.Caption>
                <h3>a</h3>
                <p>a</p>
            </Carousel.Caption>
        </>
    )
}

export default MyCarousel
